query:
-- First get or create Alameda County EMS Agency
INSERT IGNORE INTO counties (name, state, protocolVersion, createdAt) 
VALUES ('Alameda County EMS Agency', 'California', '2025', NOW());

-- Get the agency ID
SELECT id INTO @alameda_id FROM counties WHERE name = 'Alameda County EMS Agency' AND state = 'California' LIMIT 1;

-- Show current count
SELECT @alameda_id as agency_id, 
       (SELECT COUNT(*) FROM protocolChunks WHERE countyId = @alameda_id) as current_protocols;

